import React, { Component } from 'react';
import './index.css';

class Data extends Component {
  constructor() {
    super();

    this.state = {
      data: {}
    }
  }
  render() {
    console.log(this.state.data);
    return (
      <div>
        <h1>Data</h1>
        <p>You can see this now</p>
        <button onClick={this.getData} className="btn btn-primary">Get Data</button>
      </div>
    );
  }
}

export default Data;
